// Helper function to get a specific value from the data
// Returns 0.0 if indices are out of bounds
inline float get_csv_value(int row, int col) {
    if (row < 0 || row >= NUM_DATA_ROWS || col < 0 || col >= row_lengths[row]) {
        return 0.0f;
    }
    return csv_data[row][col];
}

